import React from 'react';
import { BrowserRouter ,Switch, Route} from 'react-dom';
import Home from "./core/Home"

const Routes = () => {
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path = "/" component={Home} />     
            </Switch>
        </BrowserRouter>
    )
}

export default Routes;
